  justify-content: left;
  align-items: center;
  background-color: #ffffff;
  width: 100%;
  height: calc(100vh - 90);
  padding: 20px;
`;

const Footer = () => {
  return (
    <StyledFooter>
      &copy;{new Date().getFullYear()} Employee Tracks | Keldan Cundy{" "}
    </StyledFooter>
  );
};

export default Footer;
